import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const SideNav = () => {
  const [isSkillsSubMenuOpen, setSkillsSubMenuOpen] = useState(false);

  const toggleSkillsSubMenu = () => {
    setSkillsSubMenuOpen(!isSkillsSubMenuOpen);
  };

  return (
    <nav id="sidebarMenu" className="min-vh-100 col-md-3 col-lg-2 d-md-block sidebar collapse">
      <div className="position-sticky pt-3">
        <ul className="nav flex-column">
          {/* Other menu items */}

          {/* Skills Submenu */}
          <li className="nav-item">
            <a 
              href="#skillsSubmenu" 
              className="nav-link text-white d-flex justify-content-between align-items-center" 
              data-bs-toggle="collapse" 
              aria-expanded={isSkillsSubMenuOpen}
              onClick={toggleSkillsSubMenu}
            >
              <span>
                <i className="fas fa-layer-group"></i> Skills
              </span>
              <i className="fas fa-caret-down"></i>
            </a>
            <div className={`collapse ${isSkillsSubMenuOpen ? 'show' : ''}`} id="skillsSubmenu">
              <ul className="btn-toggle-nav list-unstyled fw-normal pb-1 small">
                <li>
                  <Link className="nav-link text-white" to="/dashboard/skills-assessment">
                    <i className="fas fa-brain"></i> Skills Assessment
                  </Link>
                </li>
                <li>
                  <Link className="nav-link text-white" to="/dashboard/skill-endorsements">
                    <i className="fas fa-thumbs-up"></i> Skill Endorsements
                  </Link>
                </li>
              </ul>
            </div>
          </li>

          {/* Other menu items */}
        </ul>
      </div>
    </nav>
  );
};

export default SideNav;
